function Hello () {
  const clickHandler = (e) => {
    // 阻止默認行為
    e.preventDefault()
    console.log('函數組件中的事件被觸發了', e)
  }
  return <div><a onClick={clickHandler} href='https://www.google.com.tw/?hl=zh_TW'>GOOGLE</a></div>
}

function App () {
  return (
    <div className="App">
      <Hello />
    </div>
  )
}

export default App
